const Button = ({text, nagivateToMain}) => {

    const navigate = useNavigate()

    const navigateToMain = () => {
        navigate('../pages/main')
    }
    return (
        <button class="button" onClick={navigateToMain}>
            {text}
        </button>
    )
}

export default Button;
